import { Link } from "react-router-dom";

function Team(props) {
  return (
    <section className="team">
      <div className="team__container _container">
        <div className="team__list list-team">
          {props.teamImages.map((e, i) => {
            return (
              <div className="list-team_item">
                <figure className="list-team_figure">
                  <img
                    src="./team/team1.png"
                    alt="team-1"
                    className="list-team_image"
                  />
                </figure>
                <div className="list-team_container">
                  <Link to="/team" className="list-team_link _link">
                    {props.upper}
                  </Link>
                  <h2 className="list-team_title _title">{props.title}</h2>
                  <span className="list-team_name">{props.name}</span>
                  <span className="list-team_job">{props.job}</span>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </section>
  );
}

export default Team;
